import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit,
}) => {
  return (
    <form onSubmit={handleSubmit}>
      <label htmlFor="name">
        <input
          type="text"
          name="name"
          value={name}
          onChange={(e) => setName(e.target.value)}
          required
          placeholder="Name"
          aria-label="Name"
        />
      </label>
      <br />
      <label htmlFor="phone">
        <input type="tel" name="phone" value={phone} onChange={(e) => setPhone(e.target.value)} required placeholder="Phone" />
      </label>
      <br />
      <label htmlFor="email">
        <input type="email" value={email} />
      </label>
      <br />
      <input type="submit" value="Add Contact" aria-label="Add Contact" />
    </form>
  );
};
